import React from 'react'
import {useSelector} from 'react-redux'

function Card(props) {

  const recipe = useSelector(state => state.recipe)//TRAETE DEL ESTADO EL RECIPE
    return (
         <div>
            {
                recipe.length>0 ? 
                <div>
                    <img src={props.img} alt="img not found" />
                    <hr/>
                    <h1>{props.title}</h1>

                </div>
                :
                <h1>Cargando...</h1>
            }

        </div>

    )
}

export default Card
